import React from "react";



function Galeria(){
    return(
        
        <section className="galeria contenedor">
       <div className="contenedor">
            <h2 className="titulo">Nuestro ambiente</h2>
            <article className="galeria-cont">
                <img src="img/foto1.jpg" alt=""></img>
                <img src="img/foto2.jpg" alt=""></img>
                <img src="img/foto3.jpg" alt=""></img>
                <img src="img/foto4.jpg" alt=""></img>
                <img src="img/foto5.jpg" alt=""></img>
                <img src="img/foto6.jpg" alt=""></img>
            </article>
        </div>
    </section>
    
    
        
    )
}

export default Galeria;
